$(function(){Vue.component("pagination",{template:"#pagination-template",props:{perPages:{type:Number,"default":9},page:{type:Number,"default":1},limit:{type:Number,"default":10},count:{type:Number,"default":1}},methods:{prev:function(){this.page>1&&this.go(this.page-1)},next:function(){this.page<this.totalPage&&this.go(this.page+1)},first:function(){this.page!==1&&this.go(1)},last:function(){this.page!==this.totalPage&&this.go(this.totalPage)},go:function(n){if(this.page!==n){let t=new URL(window.location.href);t.searchParams.set("limit",this.limit);t.searchParams.set("page",n);window.location.href=t.toString()}}},computed:{totalPage:function(){return Math.ceil(this.count/this.limit)},disablePre:function(){return this.page<=1},disableFirst:function(){return this.page===1},disableLast:function(){return this.page===this.totalPage},disableNext:function(){return this.page>=this.totalPage},pagers:function(){const i=[],t=this.totalPage;let r=this.page;const u=this.perPages%2==0?this.perPages/2:Math.ceil(this.perPages/2)+1,n={start:r-u,end:r+u};n.start<1&&(n.end=n.end+(1-n.start),n.start=1);n.end>t&&(n.start=n.start-(n.end-t),n.end=t);n.start<1&&(n.start=1);for(let t=n.start;t<=n.end;t++)i.push(t);return i}}})});